import { Component, OnInit, ViewChild, ElementRef} from '@angular/core';
import { UserService } from '../../services/user.service';
import { MedicoService } from '../../services/medico.service';
import { PlatformLocation } from '@angular/common';
import * as jsPDF from 'jspdf'
import * as moment from 'moment';
import { ApplicationService } from '../../services/app.service';
import { ActivatedRoute } from '@angular/router';

// Validaciones
import {FormControl, Validators} from '@angular/forms';

@Component({
  selector: 'app-listado-pacientes',
  templateUrl: './listado-pacientes.component.html',
  styleUrls: ['./listado-pacientes.component.css'],
  providers: [UserService, MedicoService, ApplicationService],
})
export class ListadoPacientesComponent implements OnInit {
  cedula = new FormControl('', [Validators.required, Validators.minLength(6), Validators.pattern('[0-9]*')]);
  loading;
  infoHc;
  infoHistoriaClinica;
  statusText;
  status;
  public imagen;
  public infoUser;

  @ViewChild('content') content: ElementRef;
  @ViewChild('contentRemision') contentRemision: ElementRef;
  @ViewChild('contentCertificado') contentCertificado: ElementRef;
  @ViewChild('contentCertificadoObservaciones') contentCertificadoObservaciones: ElementRef;

  constructor(private _userService: UserService, private _medicoService: MedicoService, location: PlatformLocation, 
    private _aplicationService : ApplicationService, private _route: ActivatedRoute) { 

    location.onPopState(() => {
      document.getElementById('btn-cerrar-moda-ver-hc').click();
    });

  }

  ngOnInit() {

    if(this._route.params) { 
      this._route.params.subscribe(params => {

        if(params['cedula']) {
           console.log('aqui');
            this.cedula.setValue(params['cedula']);
            this.buscarCedula();
        }  
      // this.id_servicio = params['id_servicio'];
      // this.getUser(this.id_usuario);
      // this.getHistoriasClinicas(this.id_usuario, this.id_servicio);
    });
    } 

    
    this.imagen = "data:image/png;base64,";
  }

  buscarCedula() {

    this.loading = true;
    let identity = this._userService.getIdentity().medico_id;
    // console.log(identity, this.cedula.value);

    this._medicoService.getHistoriasClinicaPorUsuario(identity, this.cedula.value).subscribe((response) => {
      this.loading = false;
      console.log(response);
      this.infoHc = response;    

      if(this.infoHc.length >= 1) {

        this.getUser(this.infoHc[0].id_usuario);
      }

      
      

    }, (err)=> {
      this.status = 'error';
      this.statusText = 'Error en la conexion, por favor revisa tu conexion o intentalo mas tarde.';
      this.loading = false;
      // console.log(err);
    });

  }

  getUser(id) {
    // console.log(id);

    this._aplicationService.getUser(id).subscribe( (response) => {
      this.infoUser = response;
      console.log(this.infoUser);

    

    }, (err) => {
      console.log(err);
    });
  }


  verHistoriaClinica(info) {
    this.infoHistoriaClinica = info;
    console.log(this.infoHistoriaClinica);

    document.getElementById('btn-ver-hc').click();
  }

  pdfMedicamentos() {

    console.log('aqui medicamentos');

    var doc = new jsPDF();
    
    let content = this.content.nativeElement;
    let specialElementHandlers = {
      '#editor': function(element, renderer) {
        return true;
      }
    };

    doc.addImage(this.imagen, 'JPEG', 0,0,210,250);

    doc.setFont("courier");
    doc.setFontStyle("normal");
    doc.setFontSize(12);
    doc.text(132, 55, moment(this.infoHistoriaClinica.CreatedAT).format('DD-MM-YYYY'));
    doc.text(42, 70, this.infoUser.nombres);
    doc.fromHTML(content.innerHTML, 45, 85, {
      'width': 140,
      'elementHandlers': specialElementHandlers
    });


    doc.save('medicamentos_' + this.infoUser.nombres + '.pdf');

  }


  pdfRemision() {

    var doc = new jsPDF();
    
    let content = this.contentRemision.nativeElement;
    let specialElementHandlers = {
      '#editor': function(element, renderer) {
        return true;
      }
    };

    doc.addImage(this.imagen, 'JPEG', 0,0,210,250);

    doc.setFont("courier");
    doc.setFontStyle("normal");
    doc.setFontSize(12);
    doc.text(132, 55, moment(this.infoHistoriaClinica.CreatedAT).format('DD-MM-YYYY'));
    doc.text(42, 70, this.infoUser.nombres);
    doc.fromHTML(content.innerHTML, 45, 85, {
      'width': 140,
      'elementHandlers': specialElementHandlers
    });


      doc.save('remision_' + this.infoUser.nombres + '.pdf');

  }


  pdfCertificado() {

    var doc = new jsPDF();

    var img = 'data:image/jpeg;base64,';

    let content = this.contentCertificado.nativeElement;
    let specialElementHandlers = {
      '#editor': function(element, renderer) {
        return true;
      }
    };

    let content2 = this.contentCertificadoObservaciones.nativeElement;
    let specialElementHandlers2 = {
      '#editor': function(element, renderer) {
        return true;
      }
    };
    

    doc.addImage(img, 'JPEG', 0,0,210,250);

    doc.setFont("courier");
    doc.setFontStyle("normal");
    doc.setFontSize(12);
    doc.text(43, 40, moment(this.infoHistoriaClinica.CreatedAT).format('DD-MM-YYYY'));
    doc.text(43, 48, this.infoUser.nombres);
    doc.text(43, 56, this.infoUser.cedula.toString());
    // doc.text(1, 1, identificacion);

    let ffod = this.infoHistoriaClinica.formulaFinalOd.split(' ',7);
    let ffoi = this.infoHistoriaClinica.formulaFinalOi.split(' ',7);

    let esferaOd = ffod[0] + ' ' + ffod[1];
    let cilindroOd = ffod[2] + ' ' + ffod[3];
    let ejeOd = ffod[4] + ' ' + ffod[5]

    let esferaOi = ffoi[0] + ' ' + ffoi[1];
    let cilindroOi = ffoi[2] + ' ' + ffoi[3];
    let ejeOi = ffoi[4] + ' ' + ffoi[5]

    console.log(ffod);
    console.log(esferaOd, cilindroOd, ejeOd);

    // esfera
    doc.text(53, 86, esferaOd); //OD
    doc.text(53, 95, esferaOi); //OI

    // cilindro
    doc.text(81, 86,  cilindroOd); //OD 
    doc.text(81, 95, cilindroOi); //OI

    // eje
    doc.text(109, 86, ejeOd); //OD
    doc.text(109, 95, ejeOi); //OI

    // Add
    doc.text(136, 86, this.infoHistoriaClinica.adicionOd); //OD
    doc.text(136, 95, this.infoHistoriaClinica.adicionOi); //OI

    // Dp
    doc.text(164, 86, this.infoHistoriaClinica.dnpOd); //OD
    doc.text(164, 95, this.infoHistoriaClinica.dnpOi); //OI

    //Oftalmologia
    doc.text(73, 120, this.infoHistoriaClinica.oftalmologiaOd); //OD
    doc.text(73, 125, this.infoHistoriaClinica.oftalmologiaOi); //OI

    //Examen motor
    doc.text(73, 130, this.infoHistoriaClinica.examenMotorOd); //OD
    doc.text(73, 135, this.infoHistoriaClinica.examenMotorOi); //OI


    // //Refraccion
    doc.text(73, 139, this.infoHistoriaClinica.refraccionOd); //OD

    doc.text(73, 144, this.infoHistoriaClinica.refraccionOi); //OI

    // //Test ishihara
    doc.text(73, 148, this.infoHistoriaClinica.testIshihara);

    // //test de estereopsis
    doc.text(73, 153, this.infoHistoriaClinica.testEstereopsis);
 
    // //Diagnostico
    // doc.text(73, 180, '43/43/43');

    doc.fromHTML(content.innerHTML, 73, 149, {
      'width': 118,
      'elementHandlers': specialElementHandlers
    });

    doc.fromHTML(content2.innerHTML, 73, 176, {
      'width': 118,
      'elementHandlers': specialElementHandlers
    });

    doc.save('certificado_' + this.infoUser.nombres + '.pdf');

  }



}
